import React from "react";
import Header from './Header';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Customize from "./Customize";

function App() {
  return (
    <>
    <Header />
    <Router>
    <Switch>
          <Route exact path="/">
            <Customize />
          </Route>
          <Route path="/checkout">
          <h1>Checkout</h1>
          </Route>
        </Switch>
    </Router>
    </>

  );
}

export default App;
